import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import { red } from '@material-ui/core/colors';
import { Paper } from '@material-ui/core';

const useStyles = makeStyles((theme) => ({
  root: {
    maxWidth: "100%",

  },
  media: {
    height: 0,
    paddingTop: '56.25%', // 16:9
  },
  expand: {
    transform: 'rotate(0deg)',
    marginLeft: 'auto',
    transition: theme.transitions.create('transform', {
      duration: theme.transitions.duration.shortest,
    }),
  },
  expandOpen: {
    transform: 'rotate(180deg)',
  },
  avatar: {
    backgroundColor: red[500],
  },
}));

export function MessageDetail() {
  const classes = useStyles();
  const [expanded, setExpanded] = React.useState(false);

  const handleExpandClick = () => {
    setExpanded(!expanded);
  };

  return (
    <ChatContainer>
      <ConversationHeader>
        <ConversationHeader.Back />
        <Avatar src={zoeIco} name="Zoe" />
        <ConversationHeader.Content userName="Zoe" info="Active 10 mins ago" />
        <ConversationHeader.Actions>
          <VoiceCallButton />
          <VideoCallButton />
          <InfoButton />
        </ConversationHeader.Actions>
      </ConversationHeader>
      <MessageList typingIndicator={<TypingIndicator content="Zoe is typing" />}>

        <MessageSeparator content="Saturday, 30 November 2019" />

        <Message model={{
          message: "Hello my friend",
          sentTime: "15 mins ago",
          sender: "Zoe",
          direction: "incoming",
          position: "single"
        }}>
          <Avatar src={zoeIco} name="Zoe" />
        </Message>

        <Message model={{
          message: "Hello my friend",
          sentTime: "15 mins ago",
          sender: "Patrik",
          direction: "outgoing",
          position: "single"
        }} avatarSpacer />
        <Message model={{
          message: "Hello my friend",
          sentTime: "15 mins ago",
          sender: "Zoe",
          direction: "incoming",
          position: "first"
        }} avatarSpacer />
        <Message model={{
          message: "Hello my friend",
          sentTime: "15 mins ago",
          sender: "Zoe",
          direction: "incoming",
          position: "normal"
        }} avatarSpacer />
        <Message model={{
          message: "Hello my friend",
          sentTime: "15 mins ago",
          sender: "Zoe",
          direction: "incoming",
          position: "normal"
        }} avatarSpacer />
        <Message model={{
          message: "Hello my friend",
          sentTime: "15 mins ago",
          sender: "Zoe",
          direction: "incoming",
          position: "last"
        }}>
          <Avatar src={zoeIco} name="Zoe" />
        </Message>

        <Message model={{
          message: "Hello my friend",
          sentTime: "15 mins ago",
          sender: "Patrik",
          direction: "outgoing",
          position: "first"
        }} />
        <Message model={{
          message: "Hello my friend",
          sentTime: "15 mins ago",
          sender: "Patrik",
          direction: "outgoing",
          position: "normal"
        }} />
        <Message model={{
          message: "Hello my friend",
          sentTime: "15 mins ago",
          sender: "Patrik",
          direction: "outgoing",
          position: "normal"
        }} />
        <Message model={{
          message: "Hello my friend",
          sentTime: "15 mins ago",
          sender: "Patrik",
          direction: "outgoing",
          position: "last"
        }} />

        <Message model={{
          message: "Hello my friend",
          sentTime: "15 mins ago",
          sender: "Zoe",
          direction: "incoming",
          position: "first"
        }} avatarSpacer />
        <Message model={{
          message: "Hello my friend",
          sentTime: "15 mins ago",
          sender: "Zoe",
          direction: "incoming",
          position: "last"
        }}>
          <Avatar src={zoeIco} name="Zoe" />
        </Message>
      </MessageList>
      <MessageInput placeholder="Type message here" value={messageInputValue} onChange={val => setMessageInputValue(val)} onSend={() => setMessageInputValue("")} />
    </ChatContainer>
  );
}
